import "bootstrap/dist/css/bootstrap.min.css";

function VictimReqMain() {
  const styles = {
    cardImg: {
      width: "15vw",
      height: "10",
    },
  };
  return (
    <>
      <div style={{ margin: "auto", width: "50%" }} className="mt-5">
        <Card style={{ width: "30rem" }} classNam="mt-5">
