            <Col sm={6}>
              <Card.Img
                style={styles.cardImg}
                src={require("../../images/shelter.png")}
              />
            </Col>
            <Col sm={6}>
              {" "}
              <Button className="align-items-center" variant="primary">
                Go somewhere
              </Button>
            </Col>
          </Row>
          <Row>
            <Col sm={6}>
              <Card.Img
               style={styles.cardImg}
                src={require("../../images/shelter.png")}
              />
            </Col>
